import '../views/Nav.scss'
const Nav = () => {
    return (
        <div className='menus'>
            <ul>
                <li><a className="active" href="/">Home</a></li>
                <li><a href="/timer">Timer App</a></li>
                <li><a href="/todo">To do Apps</a></li>
                <li><a href="/secret">Secret</a></li>
            </ul>
        </div>
    );
}

export default Nav;
